import React from 'react'
import {OfferGroupWrapper} from '../style'
import {Col, Row} from 'antd'
import {useStore} from 'effector-react'
import {$offeringsModel} from '../../../../Models/offerings-model'

export const OverlayOfferingGroup = () => {
    const {$offeringGroupList: {data}} = useStore($offeringsModel)

    return (
        <OfferGroupWrapper>
            <Row gutter={[8, 12]}>
                {
                    data && data.map((item, idx) => (
                        <Col key={`${idx + 1}`} className='gutter-row' span={8}>
                            {item.name}
                        </Col>
                    ))
                }
            </Row>
        </OfferGroupWrapper>
    )
}
